  name: CoordinateSystemMapQuestFactory
  nameWithType: CoordinateSystemMapQuestFactory
  fullName: MapQuest.CoordinateSystems.CoordinateSystemMapQuestFactory
  type: Class
  assemblies:
  - MapQuest.CoordinateSystems
  namespace: MapQuest.CoordinateSystems
  summary: >-
    MapQuest.co.jp 社が定める GridID により 

    <xref href="MapQuest.CoordinateSystems.ICoordinateSystem" data-throw-if-not-resolved="false"></xref> を生成するファクトリクラスです。
  remarks: >-
    このクラスは、<xref href="MapQuest.CoordinateSystems.CoordinateSystemMapQuestFactory.Create(System.Int32)" data-throw-if-not-resolved="false"></xref> メソッドにて、MapQuest.co.jp 社が定めた

    座標系番号である <b>GridID</b> を指定して、

    それに応じた座標系を生成して返すものです。

    <p></p>

    id として指定できる GridID とその意味を下記に示します。

    <ul><li><b>1 ～ 19</b> - 平面直角座標系(日本測地系)を表します。</li><li><b>101 ～ 160</b> - UTM座標系を表します。楕円体は WGS84 を使用します。

    値から 100 を減算したものが UTM で定められるゾーンに該当します。

    例えば 105 は、「UTM ゾーン 5」を示します。</li><li><b>201 ～ 219</b> - 平面直角座標系(世界測地系)を表します

    (※楕円体は GRS80 を使用します)。

    値から 200 を減算したものが、平面直角座標系 の 1 ～ 19 に対応します。

    例えば東京都付近の世界測地系の平面直角座標系を表す GridID は 209 です。</li></ul>

    これらの数値は定数としても用意されています。<xref href="MapQuest.CoordinateSystems.CoordinateSystemMapQuestFactory.TOKYO_01" data-throw-if-not-resolved="false"></xref> 、

    <xref href="MapQuest.CoordinateSystems.CoordinateSystemMapQuestFactory.JGD2000_01" data-throw-if-not-resolved="false"></xref> 、 <xref href="MapQuest.CoordinateSystems.CoordinateSystemMapQuestFactory.UTM_ZONE01" data-throw-if-not-resolved="false"></xref> を参照して下さい。
  example: []
  syntax:
    content: 'public class CoordinateSystemMapQuestFactory : ICoordinateSystemSimpleFactory'
